/* The method UpdateLayout() is invoked automatically after the size of the component 
   has been changed. This method can be overridden and filled with logic to perform 
   a sophisticated arrangement calculation for one or more enclosed views. In this 
   case the parameter aSize can be used. It contains the current size of the component. 
   Usually, all enclosed views are arranged automatically accordingly to their @Layout 
   property. UpdateLayout() gives the derived components a chance to extend this 
   automatism by a user defined algorithm. */
void FlatAnalogDisplay_UpdateLayout( FlatAnalogDisplay _this, XPoint aSize )
{
  XInt32 centerX;
  XInt32 centerY;
  XInt32 w;
  XInt32 h;

  CoreGroup_UpdateLayout((CoreGroup)_this, aSize );
  centerX = aSize.X / 2;
  centerY = aSize.Y / 2;
  w = _this->ImageLeft.Bitmap->FrameSize.X;
  h = _this->ImageLeft.Bitmap->FrameSize.Y / 2;
  CoreRectView__OnSetBounds( &_this->ImageLeft, EwNewRect( centerX - w, centerY 
  - h, centerX, centerY + h ));
  CoreRectView__OnSetBounds( &_this->ImageRight, EwNewRect( centerX, centerY - h, 
  centerX + w, centerY + h ));
  CoreRectView__OnSetBounds( &_this->NeedleRight, _this->ImageRight.Super1.Bounds 
  );
}

/* The method UpdateViewState() is invoked automatically after the state of the 
   component has been changed. This method can be overridden and filled with logic 
   to ensure the visual aspect of the component does reflect its current state. 
   For example, the 'enabled' state of the component can affect its colors (disabled 
   components may appear pale). In this case the logic of the method should modify 
   the respective color properties accordingly to the current 'enabled' state. 
   The current state of the component is passed as a set in the parameter aState. 
   It reflects the very basic component state like its visibility or the ability 
   to react to user inputs. Beside this common state, the method can also involve 
   any other variables used in the component as long as they reflect its current 
   state. For example, the toggle switch component can take in account its toggle 
   state 'on' or 'off' and change accordingly the location of the slider, etc.
   Usually, this method will be invoked automatically by the framework. Optionally 
   you can request its invocation by using the method @InvalidateViewState(). */
void FlatAnalogDisplay_UpdateViewState( FlatAnalogDisplay _this, XSet aState )
{
  XFloat angle;

  /* Dummy expressions to avoid the 'C' warning 'unused argument'. */
  EW_UNUSED_ARG( aState );

  angle = 360.000000f;

  if ((( _this->MaxValue > _this->MinValue ) && ( _this->CurrentValue >= _this->MinValue 
      )) && ( _this->CurrentValue <= _this->MaxValue ))
  {
    angle = angle - (( 360.000000f * (XFloat)( _this->CurrentValue - _this->MinValue 
    )) / (XFloat)( _this->MaxValue - _this->MinValue ));
  }

  if ( _this->ShowCurrent )
    ViewsText_OnSetString( &_this->ValueText, FlatAnalogDisplay_formatValueString( 
    _this, _this->CurrentValue ));

  ViewsText_OnSetVisible( &_this->ValueText, _this->ShowCurrent );

  if ( angle != _this->RotateNeedleEffect.Value )
  {
    EffectsEffect_OnSetEnabled((EffectsEffect)&_this->RotateNeedleEffect, 0 );
    _this->RotateNeedleEffect.Value = (( _this->RotateNeedleEffect.Value * 9.000000f 
    ) + angle ) / 10.000000f;
    _this->RotateNeedleEffect.Value1 = _this->RotateNeedleEffect.Value;
    _this->RotateNeedleEffect.Value2 = angle;
    EffectsEffect_OnSetEnabled((EffectsEffect)&_this->RotateNeedleEffect, 1 );
  }
}

/* 'C' function for method : 'Flat::AnalogDisplay.OnSetCurrentValue()' */
void FlatAnalogDisplay_OnSetCurrentValue( FlatAnalogDisplay _this, XInt32 value )
{
  if ( value < _this->MinValue )
    value = _this->MinValue;

  if ( value > _this->MaxValue )
    value = _this->MaxValue;

  if ( _this->CurrentValue == value )
    return;

  _this->CurrentValue = value;
  CoreGroup_InvalidateViewState((CoreGroup)_this );
}

/* This slot method will receive a signal, if the value of the property assigned 
   to @Outlet has been changed by another widget or by the application logic. In 
   response to this notification, the widget will update itself. */
void FlatAnalogDisplay_outletSlot( FlatAnalogDisplay _this, XObject sender )
{
  XInt32 tempe;

  /* Dummy expressions to avoid the 'C' warning 'unused argument'. */
  EW_UNUSED_ARG( sender );

  tempe = 0;
  {
    set=!PSDHT11_Init();
    PSDHT11Read(&Rh,&RhDec,&Temp,&TempDec,&ChkSum);
    HAL_Delay(3000);
      tempe=Temp;

  }

  if ( _this->Outlet.Object != 0 )
    FlatAnalogDisplay_OnSetCurrentValue( _this, EwOnGetInt32( _this->Outlet ));
}

/* 'C' function for method : 'Flat::AnalogDisplay.OnSetOutlet()' */
void FlatAnalogDisplay_OnSetOutlet( FlatAnalogDisplay _this, XRef value )
{
  if ( !EwCompRef( _this->Outlet, value ))
    return;

  if ( _this->Outlet.Object != 0 )
    EwDetachRefObserver( EwNewSlot( _this, FlatAnalogDisplay_outletSlot ), _this->Outlet, 
      0 );

  _this->Outlet = value;

  if ( value.Object != 0 )
    EwAttachRefObserver( EwNewSlot( _this, FlatAnalogDisplay_outletSlot ), value, 
      0 );

  if ( value.Object != 0 )
    EwPostSignal( EwNewSlot( _this, FlatAnalogDisplay_outletSlot ), ((XObject)_this 
      ));
}

/* Method to format a string based on the given aValue and the current @DotPosition 
   and @Divisor. */
XString FlatAnalogDisplay_formatValueString( FlatAnalogDisplay _this, XInt32 aValue )
{
  XInt32 val = aValue / _this->Divisor;
  XInt32 abs = val;

  if ( val < 0 )
    abs = -val;

  if ( _this->DotPosition == 1 )
    return EwConcatString( EwConcatString( EwNewStringInt( val / 10, 1, 10 ), EwLoadString( 
      &_Const0013 )), EwNewStringInt( abs % 10, 1, 10 ));
  else
    if ( _this->DotPosition == 2 )
      return EwConcatString( EwConcatString( EwNewStringInt( val / 100, 1, 10 ), 
        EwLoadString( &_Const0013 )), EwNewStringInt( abs % 100, 2, 10 ));
    else
      if ( _this->DotPosition == 3 )
        return EwConcatString( EwConcatString( EwNewStringInt( val / 1000, 1, 10 
          ), EwLoadString( &_Const0013 )), EwNewStringInt( abs % 1000, 3, 10 ));

  return EwNewStringInt( val, 0, 10 );
}

/* Slot method to rotate the needle according calculated value from float effect. */
void FlatAnalogDisplay_rotateNeedle( FlatAnalogDisplay _this, XObject sender )
{
  XFloat angle;

  /* Dummy expressions to avoid the 'C' warning 'unused argument'. */
  EW_UNUSED_ARG( sender );

  angle = _this->RotateNeedleEffect.Value;

  if ( angle > 360.000000f )
    angle = 360.000000f;

  if ( angle < 0.000000f )
    angle = 0.000000f;

  FlatanalogNeedle_OnSetAngle( &_this->Needle, angle );

  if ( angle > 180.000000f )
  {
    CoreRectView__OnSetBounds( &_this->Needle, _this->ImageRight.Super1.Bounds );
    ViewsImage_OnSetVisible( &_this->NeedleRight, 0 );
  }
  else
  {
    CoreRectView__OnSetBounds( &_this->Needle, _this->ImageLeft.Super1.Bounds );
    ViewsImage_OnSetVisible( &_this->NeedleRight, 1 );
  }
}

